claims:
1. A reusable external infusion device with a predetermined usage life for infusing a fluid into a body, the infusion device comprising:
      a housing; 
      a replaceable reservoir receivable in the housing that contains the fluid before infusing, wherein the replaceable reservoir has a usage life substantially shorter than the predetermined usage life of the infusion device; 
      a power supply contained in the housing; 
      a drive system coupled to the power supply and that forces fluid from the reservoir; and 
      an electronics system coupled to the power supply and the drive system and that regulates the power from the power supply to the drive system; 
      wherein after the infusion device's predetermined usage life has expired, the infusion device may be refurbished at least once to function for another predetermined usage life.

3. A reusable external infusion device for infusing a fluid into an individual, the reusable external infusion device comprising:
      a housing; 
      replaceable reservoir that is inserted into the housing and that contains the fluid; 
      a drive system that forces the fluid from the reservoir; 
      a power supply contained in the housing; and 
      an electronics system coupled to the power supply and the drive system that regulates the power from the power supply to the drive system and controls the external infusion device in accordance with one or more control parameters, 
      wherein the housing of the reusable external infusion device includes an opening to accept a tab that includes a communication device for communicating between the reusable external infusion device and a supplemental device to adjust one of the one or more control parameters of the external infusion device.

4. A reusable external infusion device for infusing a fluid into an individual, the reusable external infusion device comprising:
      a housing; 
      a replaceable reservoir that is inserted into the housing and that contains the fluid; 
      a drive system that forces the fluid from the reservoir; 
      a power supply contained in the housing; and 
      an electronics system coupled to the power supply and the drive system that regulates the power from the power supply to the drive system and controls the external infusion device in accordance with one or more control parameters 
      wherein the housing of the reusable external infusion device includes an opening to accept a tab/key that includes a communication device for communicating between the reusable external infusion device and a supplemental device to adjust one of the one or more control parameters of the external infusion device.
